import { useState } from "react";
import { CrateTodo } from "./components/CreateTodo";
import { Todos } from "./components/Todos";
import "./index.css";

const defaultTodos = [
  { id: 1, title: "Learn Framer Motion", completed: false },
  { id: 2, title: "Create nice animation", completed: false },
  { id: 3, title: "Use Reorder component", completed: false },
];

export default function App() {
  const [todos, setTodos] = useState(defaultTodos);

  return (
    <div className="App">
      <CrateTodo onCreate={setTodos} />
      <Todos todos={todos} />
    </div>
  );
}
